import Tripod from '../images/Tripod.png'
import Frame from '../images/Frame.png'
import Lens from '../images/Lens.png'

function Gear() {
  return (
    <div className='gear'>
      <div className='gear-section'>
        <img src={Tripod} alt='Tripod' />
      </div>
      <div className='gear-section'>
        <img src={Frame} alt='Frame' />
      </div>
      <div className='gear-section'>
        <img src={Lens} alt='Lens' />
      </div>
      <div className='title'>
      </div>
    </div>
  );
};

export default Gear;
